import React from "react";
import Head from "next/head";


const NextApp = ({Component}) => {
    return (
         <>
            <Head>
                <meta charSet = "UTF-8" />
                <title>Next / App</title>
            </Head>

            <Component />



        </>
    );
}

export default NextApp;
